-- Volcando estructura para procedimiento sitalbd.GetClientesEntrantes
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetClientesEntrantes`(IN inicio datetime, final datetime)
BEGIN

DROP TEMPORARY TABLE IF EXISTS tbl_temp_clientes;
CREATE TEMPORARY TABLE tbl_temp_clientes AS 
SELECT  
tbl_cdr.src AS 'Nombre',
tbl_cdr.src AS 'Numero',
COUNT(tbl_cdr.dstanswer) 'Entrantes',
SUM(tbl_cdr.duration) 'Aire',
SUM(tbl_cdr.billsec) 'Efectiva'
FROM tbl_cdr
where  CHAR_LENGTH(tbl_cdr.dstanswer) <=4
AND tbl_cdr.`start`>=inicio AND tbl_cdr.`end`<=final
GROUP by dstanswer;


UPDATE tbl_temp_clientes, (select tbl_clientes.nombre, tbl_clientes.telefono from tbl_clientes
where tbl_clientes.telefono in (select tbl_cdr.src from tbl_cdr)) src 
set tbl_temp_clientes.nombre =src.nombre WHERE tbl_temp_clientes.nombre = src.telefono;

DROP TEMPORARY TABLE IF EXISTS tbl_temp_reporteGeneral_ce;
CREATE TEMPORARY TABLE tbl_temp_reporteGeneral_ce AS 
select 
tbl_temp_clientes.Nombre,
tbl_temp_clientes.Numero,
tbl_temp_clientes.Entrantes,
tbl_temp_clientes.Aire,
SUM(tbl_temp_clientes.Aire/
(
select tbl_tarifas.tiempo 
from tbl_tarifas
INNER JOIN tbl_clientes
on tbl_tarifas.codigo=tbl_clientes.codTarifas
where 
tbl_clientes.telefono in (select tbl_temp_clientes.Numero from tbl_clientes)
)
*
(select tbl_tarifas.precio 
from tbl_tarifas
INNER JOIN tbl_clientes
on tbl_tarifas.codigo=tbl_clientes.codTarifas
where 
tbl_clientes.telefono in (select tbl_temp_clientes.Numero from tbl_clientes)
)
) AS 'CostoAire',
tbl_temp_clientes.Efectiva,
SUM(tbl_temp_clientes.Efectiva/
(
select tbl_tarifas.tiempo 
from tbl_tarifas
INNER JOIN tbl_clientes
on tbl_tarifas.codigo=tbl_clientes.codTarifas
where 
tbl_clientes.telefono in (select tbl_temp_clientes.Numero from tbl_clientes)
)
*
(select tbl_tarifas.precio 
from tbl_tarifas
INNER JOIN tbl_clientes
on tbl_tarifas.codigo=tbl_clientes.codTarifas
where 
tbl_clientes.telefono in (select tbl_temp_clientes.Numero from tbl_clientes)
)
) AS 'CostoEfectiva'
from 
tbl_temp_clientes
where 
tbl_temp_clientes.Numero in (select tbl_clientes.telefono from tbl_clientes)
GROUP by tbl_temp_clientes.Numero;

DROP TEMPORARY TABLE IF EXISTS tbl_temp_clientes;

select * from tbl_temp_reporteGeneral_ce;
DROP TEMPORARY TABLE IF EXISTS tbl_temp_reporteGeneral_ce;

END//
DELIMITER ;


