-- Volcando estructura para procedimiento sitalbd.GetLlamadas
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetLlamadas`(IN inicio datetime, final datetime)
BEGIN

DROP TEMPORARY TABLE IF EXISTS tbl_temp_llamadas;
CREATE TEMPORARY TABLE tbl_temp_llamadas AS 
SELECT  SUBSTRING_INDEX( tbl_cdr.dstanswer , '/', 1 ) AS Troncal ,
COUNT( tbl_cdr.dstanswer)as 'Total' 
FROM tbl_cdr 
where tbl_cdr.dstanswer 
in
(select distinct tbl_cdr.dstanswer from tbl_cdr  where CHAR_LENGTH(tbl_cdr.dstanswer) <=4)
AND tbl_cdr.`start`>=inicio AND tbl_cdr.`end`<=final
Group by Troncal
union
select tbl_cdr.dstanswer, 
COUNT(tbl_cdr.dstanswer)as 'Total' 
from tbl_cdr
where tbl_cdr.dstanswer 
in
(select distinct tbl_cdr.dstanswer from tbl_cdr  where CHAR_LENGTH(tbl_cdr.dstanswer) <=4)
AND tbl_cdr.`start`>=inicio AND tbl_cdr.`end`<=final
Group by tbl_cdr.dstanswer;

select * from tbl_temp_llamadas;
DROP TEMPORARY TABLE IF EXISTS tbl_temp_llamadas;

END//
DELIMITER ;


